import React from "react";
import {
  Box,
  Text,
  Accordion,
} from "@mantine/core";

import {
  IconX,
} from "@tabler/icons-react";
import CustomizeCategoryList4 from "./CustomizeCategoryList4";

const Customize4 = ({categoryListBoxVisible4}) => {
  return (
    <>
    {categoryListBoxVisible4 &&(
    <Box m="xs" h={`fit-content`} bg="gray.2" style={{ borderRadius: "10px" }}>
      
      <Box
        bg="indigo.5"
        ml="xs"
        mr="xs"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          backgroundColor: "indigo.5",
          padding: "10px",
          borderRadius: "10px",
        }}
      >
        <Text
          fw={900}
          c={`#FFFFFF`}
          style={{
            flex: "1",
            textAlign: "center",
          }}
        >
          Customize
        </Text>
        <IconX
          size={28}
          style={{
            borderRadius: "50%",
            background: "red",
            color: "white",
            alignSelf: "flex-end",
          }}
        />
      </Box>
      <Accordion
        m="xs"
        variant="contained"
        defaultValue="category-item"
        pb={10}
      >
        <Accordion.Item value="category-item">
          <Accordion.Control bg="#FFFFFF">
            <Text>Category Item</Text>
          </Accordion.Control>
          <Accordion.Panel bg="#FFFFFF">
            <CustomizeCategoryList4 />
          </Accordion.Panel>
        </Accordion.Item>
      </Accordion>
    </Box>
    )}
    </>
  );
};

export default Customize4;
